tables.table_schema:
CREATE TABLE cities (
    city_id INT PRIMARY KEY,
    city_name VARCHAR(50),
    population INT,
    district VARCHAR(50)
);

CREATE TABLE city_districts (
  district_id INT PRIMARY KEY,
  district_name VARCHAR(50) NOT NULL,
  population INT NOT NULL,
  average_income DECIMAL(10, 2)
);

CREATE TABLE city_districts (
  district_id INT PRIMARY KEY,
  district_name VARCHAR(50),
  population INT,
  land_area FLOAT
);

CREATE TABLE population_growth (
  growth_id INT PRIMARY KEY,
  district_id INT,
  growth_rate FLOAT,
  year INT
);

CREATE TABLE demographics (
  demo_id INT PRIMARY KEY,
  district_id INT,
  median_age INT,
  avg_income FLOAT
);

CREATE TABLE migration_patterns (
  migration_id INT PRIMARY KEY,
  from_district_id INT,
  to_district_id INT,
  migration_count INT
);

CREATE TABLE district_population (
   district_id INT PRIMARY KEY,
   population INT,
   area FLOAT,
   growth_rate FLOAT
);

CREATE TABLE city_districts (
   district_id INT PRIMARY KEY,
   city_name VARCHAR(255),
   population_density FLOAT,
   average_income FLOAT
);

CREATE TABLE demographic_data (
   district_id INT PRIMARY KEY,
   age_group VARCHAR(50),
   gender VARCHAR(10),
   population_count INT
);

CREATE TABLE economic_data (
   district_id INT PRIMARY KEY,
   unemployment_rate FLOAT,
   poverty_rate FLOAT,
   median_income FLOAT
);

CREATE TABLE migration_data (
   migration_id INT PRIMARY KEY,
   origin_district_id INT,
   destination_district_id INT,
   migration_count INT
);
